import React from "react";

import "./information.styles.scss";

const BirdInfo = () => {
  return (
    <div className="bird-info">
      <div className="bird-info-title">
        Послушайте плеер. Выберите птицу из списка.
      </div>
      <div className="bird-info-title">2</div>
      <div className="bird-info-title">3</div>
      <div className="bird-info-title">4</div>
      <div className="bird-info-title">5</div>
      <div className="bird-info-title">6</div>
    </div>
  );
};

export default BirdInfo;
